"original": |2-
     The IANA policy (using terms defined in [RFC5226]) for type1 enum
     extensions is Specification Required.  The IANA policy for type2 enum
     extensions is Expert Review.  The IANA policy for vendor enum
     extensions is First Come First Served.  Only attributes using the
     type1 and type2 enum syntax can be registered in the IANA IPP
     registry.
"fixed": |-
  The IANA policy (using terms defined in [RFC5226]) for type1 enum extensions is Specification Required.  The IANA policy for type2 enum extensions is Expert Review.  The IANA policy for vendor enum extensions is First Come First Served.  Only attributes using the type1 and type2 enum syntax can be registered in the IANA IPP registry.
"ko": |-
  type1 열거형 확장에 대한 IANA 정책([RFC5226]에 정의된 용어 사용)은 사양 필수입니다. type2 열거형 확장에 대한 IANA 정책은 전문가 검토입니다. 공급업체 열거형 확장에 대한 IANA 정책은 선착순입니다. type1 및 type2 열거형 구문을 사용하는 속성만 IANA IPP 레지스트리에 등록할 수 있습니다.
